import { Container,Row,Col } from "react-bootstrap";
import Catigories from "./Catigories";

const CatigoriesList = () => {
    return(
        <Row className="mt-3 flu">
           <Catigories/>
           <Catigories/>
           <Catigories/>
           <Catigories/>
        </Row>
    )
}
export default CatigoriesList;
